import React from 'react';

export default class Header extends React.Component{
    render(){
        return(
            <div style={decor.container}>
                <div style={decor.spans}>
                    <span style={decor.padding}>Sign in/Register</span>
                    <span style={decor.padding}><i className="far fa-star"></i></span>
                    <span style={decor.padding}><i className="fas fa-shopping-bag">   </i>Bag</span>
                </div>
                <div style={decor.box}>
                <img src='https://res.cloudinary.com/dyuu7x24r/image/upload/v1549900686/BlanchetteProject/logoOK.png' style={decor.header} alt="banana"/>
                </div>
            </div>
        )
    }
}

const decor = {
    container:{
        height: '150px',
    },
    box:{
        display: 'flex',
        justifyContent: 'center'
    },
    header:{
       width: '500px',
       height: '150px',
       marginTop: '1%'  
    },
    padding:{
        padding: '1em'
    },
    spans: {
        position: 'relative',
        paddingRight: '1em',
      marginRight: '2%',
      textAlign: 'right'
    },
    fav:{
        border: '0.5px'
    }
}
